import logo from "../../images/logo.svg";
import { Link } from "react-router-dom";

const LeftNav = () => {
  return (
    <div className="nav-tool flex justify-between w-3/5">
      <div className="logo logo flex items-center  ">
        <img src={logo} alt="logo" />
      </div>
      <ul className="navbar-menu text-blue-3  flex justify-around content-center w-2/3 ">
        <li className="py-10  hover:border-primary-1 hover:text-black border-b-transparent border-b-4">
          <Link className="">Collections</Link>
        </li>
        <li className="py-10  hover:border-primary-1 hover:text-black border-b-transparent border-b-4">
          <Link className="">Men</Link>
        </li>
        <li className="py-10  hover:border-primary-1 hover:text-black border-b-transparent border-b-4">
          <Link>Women</Link>
        </li>
        <li className="py-10  hover:border-primary-1 hover:text-black border-b-transparent border-b-4">
          <Link>About</Link>
        </li>
        <li className="py-10  hover:border-primary-1 hover:text-black border-b-transparent border-b-4">
          <Link>Contact</Link>
        </li>
      </ul>
    </div>
  );
};

export default LeftNav;
